  return (
    <Row id="projects">
      <Col xs="auto" className="section-title">
        <h2 className="px-2 mb-0">Projects</h2>
      </Col>
      <Col xs={12}>
        <div className="underline"></div>
      </Col>

      {projects.map((project) => 
      <>
        <Project 
          key={project.id}
          project={project}
        />
        <ProjectModal 
          project={project}
        />
      </>
      )} 


